import React, {useState} from 'react'

import IntroImg from "../assets/introimg_2.webp"


function ReserveTutorPage() {
  return (
  <div className="hero">
      <div className="mask">
        <img className="intro-img"
        src={IntroImg} alt="IntroImg"/>
      </div>
      <div className="content">
         <p>Reserve an appointment with a tutor.</p> 
         <h1>Let's see who is available!</h1>

      </div>
  </div>
  );
};

export default ReserveTutorPage
